// import React from "react";

function App(){
    let x="I Like for you"
    let y="Every Name"

    return(
        <div>
            <h1>Rocky Bhai</h1>
            <p>Don't Stop Coding Wait for Page Loading {x}</p>
            <Pass as={x} x={y}/>
        </div>
        
    )
}

function Pass(props){
    const {as,x}=props
    return(
        <div>
            <h1>Johnny {a} {x}</h1>
        <Main x={as} y={x}/>
        </div>
    )
}

function Main(){
    return(
        <div>
            <h1>Holder Das</h1>
            <Jack/>
        </div>
    )
}

function Jack(){
    return(
        <div>
            <h1>Jacky</h1>
            <King/>
        </div>
    )
}

function King(){
    return(
        <div>
            <h1>Dilli vs Rolex</h1>
            <Done/>
        </div>
    )
}

function Done(){
    return(
        <div>
            <h1>Antony Das</h1>
        </div>
    )
}

export default App;
